import ImagemPaisVEN from "../bandeiras/bandeiraVEN.jpg";



export default function BandeiraPais(props) {

    return (
          
            <img src={ImagemPais} alt="Imagem do Pais Selecionado" height="130" width="250" border="1"/>






















    )
